import axios from 'axios'
import CardList from 'pages/CardList'
import { DifferentPropertiesHeader } from 'pages/DifferentPropertiesHeader'
import Header from 'pages/HomePage/components/Header'
import { SubPropertyListHeader } from 'pages/PropertyListHeader'
import properties from 'properties'
import React, { useEffect, useState } from 'react'

export const RentDelhiFlat = () => {

    const[fetchdata,setFetchdata]=useState([])
    const[rentflat,setRentFlat]=useState("")

    const rent_flat=()=>{
        // e.preventDefault();

        const allData={reason:"Rent/ Lease",city:"Delhi",maxbudget:5000000,minbudget:100000};
             console.log(allData);
        fetchData(allData)
        rentData(allData)
        async function fetchData(allData) {
          const searchData = await axios.get(properties.search_url, { params: allData })
          setFetchdata(searchData.data.data);


        }

        async function rentData(allData) {
            const searchData = await axios.get(properties.search_url, { params: allData })
            setRentFlat(searchData.data.data);


          }

    }

    useEffect(()=>{
        rent_flat()

    },[])


    return (
       <>

        <Header/>
        <SubPropertyListHeader/>
       { rentflat &&
        <DifferentPropertiesHeader
        city={rentflat.city}

        />}
        {/* <h1 className="delflats">Luxury Flats in Delhi Under 50lac.</h1> */}
         <div className="drop-call">
               {/* <div className="drop-heading">Property Types</div> */}
               <div className="drop-links">
                   {/* <li><a href="" onClick={flat_type}>Flats in New-Delhi</a></li> */}
                   {/* <li><a href="">House/Villa in New-Delhi</a></li> */}
              </div>
          </div>

               {
                fetchdata.map((property,index)=>{
                    return (
                        <CardList
                        id={property.id}
                        city={property.city}
                        flatprice={property.flat_price}
                        location={property.location}
                        per_square_fit={property.per_square_fit}
                        furnish_status={property.furnished_status}
                        images={property.property_images}
                        reason={property.reason}
                        type={property.type}

                        />

                )})
            }

       </>
    )
}
